import React, { Component } from 'react';
import App from './App';

class Home extends Component {
    render(){
    return(
        <div>
        <BrowserRouter>
            <Route exact path="/" component={Home} />
            <Route exact path="/home" component={App} />
            {/* <Route exact path="/newTanda" component={TandaForm} /> */}
        </BrowserRouter>
        <h1>WELCOME TO MY TANDA PAGE</h1>
        </div>
    )
    }
}

export default Home;
